import React from "react";
import ToDoListItem from "./ToDoListItem";

export default function ToDoList() {
  const toDos = [
    { description: "wake up", deadline: "now" },
    { description: "sleep", deadline: "later" },
  ];
  return (
    <ul>
      {toDos.map((todo) => {
        return <ToDoListItem desciption={todo.description} deadline={todo.deadline} />;
      })}
    </ul>
  );
}
